import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { MaterielService } from 'src/app/services/materiel.service'; 

@Component({
  selector: 'app-addmateriel',
  templateUrl: './addmateriel.component.html',
  styleUrls: ['./addmateriel.component.css']
})
export class AddmaterielComponent implements OnInit{
  constructor(
    private service : MaterielService,
    private router : Router,
    private datePipe: DatePipe

  ) { }
  fournisseur:any={dateSession: null}

  ngOnInit(): void {


  }

  ajouter(): void {

      this.service.addSession(this.fournisseur).subscribe(
        data => {
          this.navigate();
        }
      );
    } 

  navigate(){
    this.router.navigate(['sidebarr'])
  }


}
